import PropTypes from "prop-types";
//인프런 강의 page와 레이아웃부분 참고

const AppLayout = ({ children }) => {
  return (
    <div>
      <div>common menu</div>
      {children}
    </div>
  );
};

AppLayout.prototype = {
  children: PropTypes.node.isRequired, //type을 정해준다.
};

export default AppLayout;
